import React, { useState, useEffect } from 'react';

function AdminGallerySection({ restaurant, supabase }) {
  const [galleryItems, setGalleryItems] = useState([]);
  const [loading, setLoading] = useState(true);
  const [filter, setFilter] = useState('all');

  useEffect(() => {
    if (!restaurant) return;

    const fetchGallery = async () => {
      try {
        setLoading(true);
        
        let query = supabase
          .from('gallery')
          .select('*')
          .eq('restaurant_id', restaurant.id);
        
        if (filter !== 'all') {
          query = query.eq('type', filter);
        }
        
        const { data, error } = await query
          .order('is_featured', { ascending: false })
          .order('order', { ascending: true });
        
        if (error) throw error;
        
        setGalleryItems(data || []);
      } catch (error) {
        console.error('Error fetching gallery:', error);
      } finally {
        setLoading(false);
      }
    };
    
    fetchGallery();
  }, [restaurant, filter, supabase]);

  const handleFilterChange = (newFilter) => {
    setFilter(newFilter);
  };

  const getTypeLabel = (type) => {
    switch (type) {
      case 'food': return 'Храна';
      case 'interior': return 'Интериор';
      case 'exterior': return 'Екстериор';
      case 'events': return 'Събития';
      default: return 'Общи';
    }
  };

  if (loading) {
    return <div>Зареждане на галерия...</div>;
  }

  return (
    <div>
      <h1>Галерия и изображения: {restaurant?.name}</h1>
      
      <div className="admin-controls">
        <div className="admin-filters">
          <button 
            className={`admin-filter-btn ${filter === 'all' ? 'active' : ''}`} 
            onClick={() => handleFilterChange('all')}
          >
            Всички
          </button>
          <button 
            className={`admin-filter-btn ${filter === 'general' ? 'active' : ''}`} 
            onClick={() => handleFilterChange('general')}
          >
            Общи
          </button>
          <button 
            className={`admin-filter-btn ${filter === 'food' ? 'active' : ''}`} 
            onClick={() => handleFilterChange('food')}
          >
            Храна
          </button>
          <button 
            className={`admin-filter-btn ${filter === 'interior' ? 'active' : ''}`} 
            onClick={() => handleFilterChange('interior')}
          >
            Интериор
          </button>
          <button 
            className={`admin-filter-btn ${filter === 'exterior' ? 'active' : ''}`} 
            onClick={() => handleFilterChange('exterior')}
          >
            Екстериор
          </button>
          <button 
            className={`admin-filter-btn ${filter === 'events' ? 'active' : ''}`} 
            onClick={() => handleFilterChange('events')}
          >
            Събития
          </button>
        </div>
        
        <button className="admin-add-btn">
          Добави изображение
        </button>
      </div>
      
      <div className="admin-gallery-container">
        {galleryItems.length === 0 ? (
          <div className="admin-no-data">
            <p>Няма добавени изображения в тази категория.</p>
          </div>
        ) : (
          <div className="admin-gallery-grid">
            {galleryItems.map(item => (
              <div key={item.id} className={`gallery-item ${item.is_featured ? 'featured' : ''}`}>
                <div className="gallery-image">
                  <img src={item.image_url} alt={item.title || 'Изображение на галерия'} />
                  {item.is_featured && (
                    <div className="featured-badge">
                      <i className="fas fa-star"></i> Featured
                    </div>
                  )}
                  <div className="gallery-overlay">
                    <button className="gallery-action-btn edit">
                      <i className="fas fa-edit"></i>
                    </button>
                    <button className="gallery-action-btn delete">
                      <i className="fas fa-trash"></i>
                    </button>
                  </div>
                </div>
                <div className="gallery-info">
                  {item.title && <h4>{item.title}</h4>}
                  {item.description && <p>{item.description}</p>}
                  <div className="gallery-meta">
                    <span className="gallery-type">{getTypeLabel(item.type)}</span>
                    <span className="gallery-order">Ред: {item.order}</span>
                  </div>
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
}

export default AdminGallerySection;
